ar, AvenirNext-Regular, arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;WenQuanYi Micro Hei&quot;, Arial, Helvetica, sans-serif; line-height: 1.2; min-height: 1rem; color: rgb(82, 82, 82);\">隐藏/显示 tab</h1><h2 style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; padding-bottom: 0.3em; font-family: &quot;Helvetica Neue&quot;, NotoSansHans-Regular, AvenirNext-Regular, arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;WenQuanYi Micro Hei&quot;, Arial, Helvetica, sans-serif; line-height: 1.225; margin-top: 14px; margin-bottom: 14px; font-size: 1.3em; border-bottom: 1px solid rgb(238, 238, 238); color: rgb(82, 82, 82);\"><a id=\"tab_2\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; color: rgb(65, 131, 196); position: absolute; margin-top: -10px;\"></a>显示“上传图片”tab</h2><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; color: rgb(82, 82, 82); font-family: &quot;Helvetica Neue&quot;, NotoSansHans-Regular, AvenirNext-Regular, arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;WenQuanYi Micro Hei&quot;, serif; font-size: 15px;\">默认情况下，编辑器不会显示“上传图片”的tab，因为你还没有配置上传图片的信息。</p><br><p>含图片，这些图片一般都是外域的（可能会有盗链）。此时如果想要忽略图片，即只粘贴文字不粘贴图片，可以使用<code>editor.customConfig.pasteIgnoreImg = true</code>来控制。默认是可以粘贴图片的。</p><h2><a id=\"_12\"></a>自定义处理粘贴的文本内容</h2><p>使用者可通过<code>editor.customConfig.paste</code></p><p></p><p>复制文本内容粘贴到编辑器中，编辑器会默认过滤掉复制文本中自带的样式，目的是让粘贴后的文本变得更加简洁和轻量。用户可通过<code>editor.customConfig.pasteFilterStyle = false</code>手动关闭掉粘贴样式的过滤。</p><p></p><h2><a id=\"_8\"></a>忽略粘贴内容中的图片</h2><p>从其他页面复制过来的内容，除了包含文字还可能包含图片，这些图片一般都是外域的（可能会有盗链）。此时如果想要忽略图片，即只粘贴文字不粘贴图片，可以使用<code>editor.customConfig.pasteIgnoreImg = true</code>来控制。默认是可以粘贴图片的。</p><h2><a id=\"_12\"></a>自定义处理粘贴的文本内容<img src=\"/Upload/images/1/2019-10-20/952a92fb-236c-4c7b-96cf-d75fe0edc508.png\" style=\"font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; max-width: 100%;\"></h2><p>使用者可通过<code>editor.customConfig.pasteTextHandle</code>对粘贴的文本内容进行自定义的过滤、处理等操作，然后返回处理之后的文本内容。编辑器最终会粘贴用户处理之后并且返回的的内容。</p><h2><a id=\"_16\"></a>示例代码</h2><p><br></p><p><img src=\"/Upload/images/1/2019-10-20/635e2b8f-abf3-4c74-832f-1b7465dde1f6.png\" style=\"max-width:100%;\"></p>','2019-10-15 09:48:01','2019-10-20 01:25:41','art哈哈哈哈测试修改哈或-15.html',1,'2019-10-20 01:50:18',1),(12,'测试添加公共','<p>测试<span style=\"font-weight: bold;\">添加公</span>告<img src=\"/Upload/images/1/2019-10-20/4013f065-9535-4110-956c-e3f9c172b9d6.jpg\" style=\"max-width: 100%;\"></p>','2019-10-20 01:45:38','2019-10-20 01:45:38','article-2019-测试添加10-20-5f6f2996.html',1,NULL,0),(13,'毕业季 | 来诉说你的心声 | remember 活动','<p style=\"text-align: center;\"><img src=\"https://i.loli.net/2019/10/10/ZcMGCjo3zhRyt9W.png\" style=\"max-width:100%;\"></p><p></p><div style=\"text-align: center;\"><code style=\"font-weight: bold; background-color: rgb(238, 236, 224); color: rgb(194, 79, 74); font-size: medium;\">世界不断旋转着 我们不断前进着 过往如同影子一般 依附在身后</code></div><div style=\"text-align: center;\"><span style=\"font-weight: bold;\"><code><code style=\"font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">我们好像听见了昨日的细语</code></code>&nbsp;&nbsp;</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold;\"><code style=\"background-color: rgb(238, 236, 224); color: rgb(194, 79, 74);\">过去&nbsp;&nbsp;是什么呢</code>&nbsp;</span></div><div style=\"text-align: center;\"><span style=\"font-size: 14px; font-weight: bold;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium;\"><code style=\"color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">我们有许多过往 少不更事的年代被毕业二字切割为几部分</code><span style=\"background-color: rgb(238, 236, 224); color: rgb(194, 79, 74);\">&nbsp;</span></span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium;\"><code style=\"color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">每一部分的记忆里 装满了不同的人</code></span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">他们的笑容 他们的小习惯 他们趴在桌上睡着的模样</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">我们或许在想起来时温馨一笑</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">我们或许&nbsp; &nbsp;不记得了</span></div><p></p><p></p><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">但是</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">那个夏天里 被艳阳照射得看不清的脸</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">快门按下时</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">众人的表情</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">印在照片上 成为珍贵难得的印记</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">很久很久以后 偶尔看见那张照片</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">会心一笑里 悬着一颗小小的眼泪</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">连绵的回忆如同海潮一般 温柔缓慢地包裹</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">同样的夏天 同样的午后</span></div><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">和过去的自己 说声你好</span></div><p></p><p style=\"text-align: center;\"><span style=\"font-weight: bold;\"><span style=\"font-size: medium; color: rgb(194, 79, 74); background-color: rgb(238, 236, 224);\">还记得当年的毕业季或者是你即将毕业或未毕业？都可以参与，来诉说你的心声。</span></span></p><p style=\"text-align: center;\"><img src=\"https://i.loli.net/2019/10/10/qob8w1pJjSP53sf.jpg\" style=\"max-width: 100%;\"><span style=\"font-weight: bold;\">&nbsp;</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(194, 79, 74); font-size: medium; font-weight: bold;\">你曾经参加过中考/高考？抑或是将要经历这场对天朝孩子的洗礼？都来写下你的祝福吧。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(194, 79, 74); font-size: medium; font-weight: bold;\">贰&nbsp;</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(194, 79, 74); font-size: medium; font-weight: bold;\">语文课本上有没有那首诗那篇文章令你深有体会？来给它写个推荐吧。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(194, 79, 74); font-size: medium; font-weight: bold;\">叁</span></p><p style=\"text-align: center;\"><img src=\"https://i.loli.net/2019/10/10/2mfrdULuwlxQR5D.jpg\" style=\"max-width:100%;\"></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">那一晃而过的暗恋岁月，你还怀念吗？那一晃而过的暗恋岁月，你还怀念吗？来记录下暗恋的岁月吧。</span></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">活动时间：即日起至你毕业那年</span></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">欢迎毕业或未毕业的你</span></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">remember 官方QQ群：222233333</span></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: medium; color: rgb(194, 79, 74);\">本帖附赠加群验证码:&nbsp;&nbsp;<span style=\"background-color: rgb(194, 79, 74);\">612</span> &nbsp;←刮开看</span></p>','2019-10-10 02:57:00','2019-10-10 03:09:57','2333毕业季来了-and-tell-you.html',1,NULL,0);

